import { NavLink } from "react-router-dom";
import logo from '../img/logo.png'

function Nav() {

    return (
        <nav className="nav">
            <img src={logo} className="logo-img" alt="JD Logo"/>
            <h1 className="logo">Julia Dearden</h1>
            <div className="nav-links">
                <NavLink to="/" className="nav-item" activeClassName="current">About</NavLink>
                <NavLink to="/projects" className="nav-item" activeClassName="current">Projects</NavLink>
                <NavLink to="/resume" className="nav-item" activeClassName="current">Resume</NavLink>
            </div>
        </nav>

    )
}

export default Nav;
